//         headers: {},
//         data: body
//     })
//         .then(function (response) {
//             return response.data;
//         });
// };

const postSignup = async (body) => {
    const response = await axios.post('http://food-power.glitch.me/sign-up/',
        JSON.stringify(body),
        {
            "headers": {
                "content-type": "application/json",
            }
        }
    )
    return response;
};

export default postSignup;
